import React from 'react';
import Frame71a from './Frame71a';

const Frame4a = () => {
  return (
    <div
      style={{
        width: '775px',
        minHeight: '606px',
        display: 'flex',
        flexDirection: 'row',
        gap: '22px',
      }}
    >
      <img
        src="/mockup.png"
        alt="Mockup"
        style={{ width: '386.58px', height: '606px', objectFit: 'cover', borderRadius: '8px' }}
      />
      <Frame71a />
    </div>
  );
};

export default Frame4a;
